		let f = function(e){
			this._publish('loaded');
		}.bind(this);
		let o = {
			auto_play: false,
			buying: false,
			sharing: false,
			download: false,
			show_artwork: false,
			show_playcount: false,
			show_user: false,
			show_comments: false,
			hide_related: true,
			visual: false,
			start_track: 0,
			callback: f,
		}
